-- Zrzut struktury funkcja ssd_reports.func_inc_var_session
DELIMITER //
CREATE FUNCTION `func_inc_var_session`(
	`reset` BIT
) RETURNS int(11)
    NO SQL
    COMMENT 'Function create id column for reports_count'
begin
      IF reset THEN
        SET @var := 0;
      ELSE
        SET @var := IFNULL(@var,0) + 1;
      END IF;
      return @var;
     end//
DELIMITER ;

