-- Zrzut struktury widok ssd_reports.reports_count
-- Usuwanie tabeli tymczasowej i tworzenie ostatecznej struktury WIDOKU
DROP TABLE IF EXISTS `reports_count`;
CREATE ALGORITHM=TEMPTABLE SQL SECURITY DEFINER VIEW `reports_count` AS select `func_inc_var_session`(0) AS `id`,`reports_preview`.`period` AS `period`,`reports_preview`.`companyName` AS `companyName`,`reports_preview`.`category` AS `category`,`reports_preview`.`agent` AS `agent`,count(`reports_preview`.`id`) AS `count` from `reports_preview` where `reports_preview`.`period` in (select distinct `reports_sd_uploaded`.`period` from `reports_sd_uploaded`) and `reports_preview`.`companyName` in (select `company`.`companyName` from `company`) and `reports_preview`.`category` in (select distinct `reports_preview`.`category` from `reports_preview` order by `reports_preview`.`category`) and `reports_preview`.`agent` in (select distinct `reports_preview`.`agent` from `reports_preview` order by `reports_preview`.`agent`) group by `reports_preview`.`period`,`reports_preview`.`companyName`,`reports_preview`.`category`,`reports_preview`.`agent` order by `func_inc_var_session`(0) desc;

-- Zrzut struktury widok ssd_reports.reports_preview
-- Usuwanie tabeli tymczasowej i tworzenie ostatecznej struktury WIDOKU
DROP TABLE IF EXISTS `reports_preview`;
CREATE ALGORITHM=TEMPTABLE SQL SECURITY DEFINER VIEW `reports_preview` AS select `r`.`id` AS `id`,`r`.`type` AS `type`,`r`.`closeDate` AS `closeDate`,`r`.`category` AS `category`,`r`.`agent` AS `agent`,`c`.`companyName` AS `companyName`,`p`.`month` AS `month`,`p`.`year` AS `year`,`u`.`username` AS `userName`,`r`.`upload_date` AS `upload_date`,str_to_date(concat(`p`.`year`,'-',`p`.`month`,'-01'),'%Y-%m-%d') AS `period` from (((`reports_sd` `r` join `company` `c` on(`r`.`company_id` = `c`.`id`)) join `reports_period` `p` on(`r`.`period_id` = `p`.`id`)) join `users` `u` on(`r`.`user_id` = `u`.`id`)) order by str_to_date(concat(`p`.`month`,'-',`p`.`year`),'%m-%Y') desc;

-- Zrzut struktury widok ssd_reports.reports_sd_uploaded
-- Usuwanie tabeli tymczasowej i tworzenie ostatecznej struktury WIDOKU
DROP TABLE IF EXISTS `reports_sd_uploaded`;
CREATE ALGORITHM=TEMPTABLE SQL SECURITY DEFINER VIEW `reports_sd_uploaded` AS select distinct `p`.`id` AS `id`,`p`.`month` AS `month`,`p`.`year` AS `year`,`c`.`companyName` AS `companyName`,`c`.`id` AS `company_id`,`u`.`username` AS `username`,str_to_date(concat(`p`.`year`,'-',`p`.`month`,'-01'),'%Y-%m-%d') AS `period` from (((`reports_sd` `r` left join `reports_period` `p` on(`p`.`id` = `r`.`period_id`)) left join `company` `c` on(`r`.`company_id` = `c`.`id`)) left join `users` `u` on(`r`.`user_id` = `u`.`id`)) order by str_to_date(concat(`p`.`year`,'-',`p`.`month`,'-01'),'%Y-%m-%d') desc,`c`.`companyName`;

