-- Usuwanie tabeli tymczasowej i tworzenie ostatecznej struktury WIDOKU
DROP TABLE IF EXISTS `user_functions_string_username`;
CREATE ALGORITHM=TEMPTABLE SQL SECURITY DEFINER VIEW `user_functions_string_username` AS select `user_functions`.`id` AS `id`,`user_functions`.`id_user` AS `id_user`,`users`.`username` AS `userName`,`user_functions`.`id_function` AS `id_function`,`functions`.`functionName` AS `functionName`,`user_functions`.`id_company` AS `id_company`,`company`.`companyName` AS `companyName` from (((`user_functions` join `users` on(`user_functions`.`id_user` = `users`.`id`)) join `functions` on(`user_functions`.`id_function` = `functions`.`id`)) join `company` on(`user_functions`.`id_company` = `company`.`id`));

